function BinaryHeap(t){this.content=[];this.scoreFunction=t}BinaryHeap.prototype={push:function(t){this.content.push(t);this.bubbleUp(this.content.length-1)},pop:function(){var t=this.content[0];var n=this.content.pop();if(this.content.length>0){this.content[0]=n;this.sinkDown(0)}return t},remove:function(t){var n=this.content.length;for(var i=0;i<n;i++){if(this.content[i]!=t)continue;var o=this.content.pop();if(i==n-1)break;this.content[i]=o;this.bubbleUp(i);this.sinkDown(i);break}},size:function(){return this.content.length},bubbleUp:function(t){var n=this.content[t],i=this.scoreFunction(n);while(t>0){var o=Math.floor((t+1)/2)-1,e=this.content[o];if(i>=this.scoreFunction(e))break;this.content[o]=n;this.content[t]=e;t=o}},sinkDown:function(t){var n=this.content.length,i=this.content[t],o=this.scoreFunction(i);while(true){var e=(t+1)*2,s=e-1;var c=null;if(s<n){var h=this.content[s],r=this.scoreFunction(h);if(r<o)c=s}if(e<n){var u=this.content[e],a=this.scoreFunction(u);if(a<(c==null?o:r))c=e}if(c==null)break;this.content[t]=this.content[c];this.content[c]=i;t=c}}};